-- ----------------------------
-- Procedure structure for fd_files_add_batch
-- ----------------------------
DROP PROCEDURE IF EXISTS `fd_files_add_batch`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `fd_files_add_batch`(
 in fCount int	
,in fdCount int)
begin
	declare ids_f text default '0';
	declare ids_fd text default '0';
	declare i int;
	set i = 0;
	
	
	while(i<fdCount) do	
		set ids_fd = concat( ids_fd,",",last_insert_id() );
		set i = i + 1;
	end while;
	set ids_fd = substring(ids_fd,3);
	
	
	set i = 0;
	while(i<fCount) do	
		set ids_f = concat( ids_f,",",last_insert_id() );
		set i = i + 1;
	end while;	
	set ids_f = substring(ids_f,3);
	
	select ids_f,ids_fd;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for fd_process
-- ----------------------------
DROP PROCEDURE IF EXISTS `fd_process`;
DELIMITER ;;
CREATE DEFINER=`gt`@`gt` PROCEDURE `fd_process`(in uidSvr int,in fd_idSvr int,in fd_lenSvr bigint(19),in perSvr varchar(6))
update up6_files set f_lenSvr=fd_lenSvr ,f_perSvr=perSvr  where f_uid=uidSvr and f_id=fd_idSvr
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for f_process
-- ----------------------------
DROP PROCEDURE IF EXISTS `f_process`;
DELIMITER ;;
CREATE DEFINER=`gt`@`gt` PROCEDURE `f_process`(in posSvr bigint(19),in lenSvr bigint(19),in perSvr varchar(6),in uidSvr int,in fidSvr int,in complete tinyint)
update up6_files set f_pos=posSvr,f_lenSvr=lenSvr,f_perSvr=perSvr,f_complete=complete where f_uid=uidSvr and f_id=fidSvr
;
